description:
Meet Sam. A spy. A hunter. And herself hunted by an enemy more ruthless and determined than any she's ever known. Sam has been running from her past her entire life but when she returns to Byzantium, the organization that employs her, and begins to pursue her pursuer, she will discover the only way to escape that past... is to confront it. This is the story of a spy with a bull's eye on her back, a human target unable to trust anyone at any time, even the man she loves. She is, quite literally, running for her life. Hunted is a smart, complex and contemporary spy series.
